var render=function render(){var _vm=this,_c=_vm._self._c;return _c("section",{staticClass:"terms-conditions-inner"},[_vm._ssrNode('<div class="container"><div class="row"><div class="col-12 mt-5 mb-5"><div class="mt-5 mb-3"><h1 class="terms-condition-title">Política de Cookies</h1></div> <p>La página web <a href="https://www.trivicare.com" class="text-info">www.trivicare.com</a> utiliza <i>cookies</i>.</p> <p>Las <i>cookies</i> son ficheros enviados a un navegador por medio de un servidor web para registrar las actividades del Usuario en una web o servicios de la página web (en adelante, los servicios). Las cookies se usan para facilitar un acceso más rápido a los servicios seleccionados, y personalizar los servicios que ofrece la página web, en base a elecciones y preferencias habituales del usuario, al hacer uso de los servicios.</p> <p>Las <i>cookies</i> se asocian a un usuario anónimo y su ordenador y no recaban datos de carácter personal. El usuario puede configurar su navegador para no permitir la instalación de <i>cookies</i> utilizadas por la página web, sin que el rechazo de las mismas impida al usuario acceder a los servicios, si bien, no permitir la instalación de <i>cookies</i>, puede hacer bajar la rapidez y calidad de funcionamiento de la página Web. </p> <p><strong>Uso de cookies por la página web.</strong></p> <p>En cumplimiento de la Ley 34/2002, de 11 de julio, de Servicios de la Sociedad de la Información y Comercio Electrónico le informamos de que este sitio web, al igual que la mayoría de los sitios en Internet, usa <i>Cookies</i> para mejorar y optimizar la experiencia del usuario. A continuación, encontrará información detallada sobre qué son las <i>Cookies</i>, qué tipología utiliza este sitio web, cómo cambiar la configuración de sus <i>cookies</i>, y qué ocurre si deshabilita las <i>Cookies</i>.</p> <p><strong>¿Qué son las Cookies?</strong></p> <p>Una <i>cookie</i> es un pequeño archivo que se descarga en el equipo del usuario con la finalidad de almacenar datos, los cuales podrán ser actualizados y recuperados por la entidad responsable de su instalación.</p> <p><strong>Las cookies pueden ser:</strong></p> <ul><li>-\t<i>Cookies</i> Técnicas/Necesarias: Son aquellas que permiten al usuario la navegación a través de una página web, plataforma o aplicación y la utilización de las diferentes opciones o servicios que en ella existan como, por ejemplo, controlar el tráfico y la comunicación de datos, identificar la sesión, acceder a partes de acceso restringido, recordar los elementos que integran un pedido, realizar el proceso de compra de un pedido, realizar la solicitud de inscripción o participación en un evento, utilizar elementos de seguridad durante la navegación, almacenar contenidos para la difusión de videos o sonido o compartir contenidos a través de redes sociales.</li> <li>-\t<i>Cookies</i> de personalización: Son aquellas que permiten al usuario acceder al servicio con algunas características de carácter general predefinidas en función de una serie de criterios en el terminal del usuario como por ejemplo serian el idioma, el tipo de navegador a través del cual accede al servicio, la configuración regional desde donde accede al servicio, etc.</li> <li>-\t<i>Cookies</i> de análisis: Son aquellas que bien tratadas por nosotros o por terceros, nos permiten cuantificar el número de usuarios y así realizar la medición y análisis estadístico de la utilización que hacen los usuarios del servicio ofertado. Para ello se analiza su navegación en nuestra página web con el fin de mejorar la oferta de productos o servicios que ofrecemos.</li> <li>-\t<i>Cookies</i> de terceros: La web de <strong>TRIVICARE</strong>, puede utilizar servicios de terceros que, por cuenta de TRIVICARE, recopilaran información con fines estadísticos de uso del Site por parte del usuario y para la prestación de otros servicios relacionados con la actividad del Website y otros servicios de internet.</li> <li>-\tDe sesión: Son un tipo de <i>cookies</i> diseñadas para recabar y almacenar datos mientras el usuario accede a una página web. Estas cookies no quedan almacenadas en el ordenador del usuario cuando caduca la sesión o este cierra el navegador.</li> <li>-\tPersistentes: Son un tipo de <i>cookies</i> en el que los datos siguen almacenados en el ordenador del usuario y pueden ser accedidos y tratados cuando el usuario abandona la página Web y cuando se vuelva a conectar a ella. Estas <i>cookies</i> pueden ser borradas en cualquier momento por el Usuario.</li> <li>-\tEn particular, este sitio Web utiliza Google Analytics, un servicio analítico de web prestado por Google Inc. Con domicilio en los Estados Unidos con sede central en 1600 Amphitheatre Parkway, Mountain View, California 94043. Para la prestación de estos servicios, estos utilizan <i>cookies</i> que recopilan la información, incluida la IP del usuario, que será transmitida, tratada y almacenada por Google en los términos fijados en la Web Google.com. Incluyendo la posible transmisión de dicha información a terceros por razones de exigencia legal o cuando dichos terceros procesen la información por cuenta de Google. </li></ul> <p>El Sitio Web recoge información del usuario mediante la instalación de las siguientes <i>cookies</i> en el disco duro del visitante. La citada información en modo alguno identifica ni es susceptible de identificar personalmente al usuario, es decir, son totalmente anónimas.</p> <p><strong>Tipos, finalidad y funcionamiento de las cookies utilizadas en la página web:</strong></p> <table class="table table-bordered"><thead><tr class="text-center"><th scope="col">Cookie</th> <th scope="col">Propiedad</th> <th scope="col">Finalidad</th> <th scope="col">Fecha de expiración</th> <th scope="col">Tipo de cookie</th></tr></thead> <tbody><tr><td><i>CookieConsent</i></td> <td>Cookiebot</td> <td>Almacena el estado de consentimiento de cookies del usuario para el dominio actual.</td> <td></td> <td>Técnica/Necesaria</td></tr> <tr><td><i>auth.strategy</i></td> <td>TriviCare</td> <td>Almacena el tipo de sesión iniciada.</td> <td></td> <td>Técnica/Necesaria</td></tr> <tr><td><i>apitrivicare_session</i></td> <td>TriviCare</td> <td>Registra la conexión con el servidor.</td> <td>1 día</td> <td>Técnica/Necesaria</td></tr> <tr><td><i>XSRF-TOKEN</i></td> <td>TriviCare</td> <td>Registra una identificación única que se utiliza para iniciar sesión en el servidor.</td> <td></td> <td>Técnica/Necesaria</td></tr> <tr><td><i>__stripe_mid</i></td> <td>Stripe</td> <td>Registra una identificación única que se utiliza para iniciar el método de pago Stripe.</td> <td></td> <td>Técnica/Necesaria</td></tr> <tr><td><i>__stripe_sid</i></td> <td>Stripe</td> <td>Registra una identificación única que se utiliza para iniciar el método de pago Stripe.</td> <td></td> <td>Técnica/Necesaria</td></tr> <tr><td><i>_ga_#</i></td> <td>Google</td> <td>Recopila datos sobre el número de veces que un usuario ha visitado el sitio web además de las fechas de la primera visita y de la más reciente. Utilizada por Google Analytics.</td> <td>399 días</td> <td>Análisis</td></tr> <tr><td><i>_ga</i></td> <td>Google</td> <td>Registra una identificación única que se utiliza para generar datos estadísticos acerca de cómo utiliza el visitante el sitio web.</td> <td>399 días</td> <td>Análisis</td></tr> <tr><td><i>vuex</i></td> <td>TriviCare</td> <td>Registra si un usuario está conectado – Esto permite al propietario de la web hacer inaccesibles algunas partes de la web, basándose en el estado de conexión del usuario.</td> <td>Persistente</td> <td>Técnica/Necesaria</td></tr> <tr><td><i>AWSALBCORS</i></td> <td>Amazon AWS</td> <td>Registra que grupo de servidores está sirviendo al visitante. Esto se utiliza en relación con el equilibrio de carga para optimizar la experiencia del usuario.</td> <td>6 días</td> <td>Técnica/Necesaria</td></tr> <tr><td><i>[SessionID#27]</i></td> <td>Paypal</td> <td>Esta cookie está suministrada por PayPal. Se utiliza en el contexto de las transacciones en la web y es necesaria para que las mismas sean seguras.</td> <td>1 día</td> <td>Técnica/Necesaria</td></tr> <tr><td><i>enforce_policy</i></td> <td>Paypal</td> <td>Esta cookie está suministrada por PayPal. Se utiliza en el contexto de las transacciones en la web y es necesaria para que las mismas sean seguras.</td> <td>365 días</td> <td>Técnica/Necesaria</td></tr> <tr><td><i>ts_c</i></td> <td>Paypal</td> <td>Utilizada en relación con la función de pago vía PayPal en la web. La cookie es necesaria para realizar una transacción segura a través de PayPal.</td> <td>399 días</td> <td>Técnica/Necesaria</td></tr> <tr><td><i>__paypal_storage__</i></td> <td>Paypal</td> <td>Utilizada en relación con la función de pago vía PayPal en la web. La cookie es necesaria para realizar una transacción segura a través de PayPal.</td> <td>Persistente</td> <td>Técnica/Necesaria</td></tr></tbody></table> <p><strong>Cómo deshabilitar las <i>cookies</i> en los principales navegadores.</strong></p> <p>Pueden bloquearse o deshabilitarse con las herramientas de configuración de su navegador. El navegador le permite rechazar la instalación de todas las <i>cookies</i>, o bien elegir rechazar solo alguna de ellas.</p> <p>Le indicamos los enlaces a las herramientas de los principales navegadores, en las que poder informarse sobre cómo deshabilitar las <i>cookies</i>.</p> <p><strong>Google Chrome</strong> <br> <a href="https://support.google.com/chrome/answer/95647?hl=es&hlrm=en" class="text-info">https://support.google.com/chrome/answer/95647?hl=es&amp;hlrm=en</a></p> <p><strong>Mozilla Firefox</strong> <br> <a href="http://support.mozilla.org/es/kb/cookies-informacion-que-los-sitios-web-guardan-en-?redirectlocale=en-US&redirectslug=Cookies" class="text-info">http://support.mozilla.org/es/kb/cookies-informacion-que-los-sitios-web-guardan-en-?redirectlocale=en-US&amp;redirectslug=Cookies</a></p> <p><strong>Apple Safari</strong> <br> <a href="http://support.apple.com/kb/PH5042?viewlocale=es_EShttp://support.apple.com/kb/HT1677?viewlocale=es_ES" class="text-info">http://support.apple.com/kb/PH5042?viewlocale=es_EShttp://support.apple.com/kb/HT1677?viewlocale=es_ES</a></p> <p><strong>Internet Explorer\n                    <br>\n                    Versión 5</strong> <br> <a href="http://support.microsoft.com/kb/196955/es" class="text-info">http://support.microsoft.com/kb/196955/es</a></p> <p><strong>Versión 6</strong> <br> <a href="http://support.microsoft.com/kb/283185/es" class="text-info">http://support.microsoft.com/kb/283185/es</a></p> <p><strong>Versiones 7 y 8</strong> <br> <a href="http://windows.microsoft.com/es-ES/windows-vista/Block-or-allow-cookies" class="text-info">http://windows.microsoft.com/es-ES/windows-vista/Block-or-allow-cookies</a></p> <p><strong>Versión 9</strong> <br> <a href="http://windows.microsoft.com/es-ES/windows7/How-to-manage-cookies-in-Internet-Explorer-9" class="text-info">http://windows.microsoft.com/es-ES/windows7/How-to-manage-cookies-in-Internet-Explorer-9</a></p> <p><strong>Versión 10 y posteriores</strong> <br> <a href="http://windows.microsoft.com/es-xl/internet-explorer/delete-manage-cookies" class="text-info">http://windows.microsoft.com/es-xl/internet-explorer/delete-manage-cookies</a></p> <p><strong>Qué ocurre si se deshabilitan las <i>cookies.</i></strong></p> <p>Si rechaza las <i>cookies</i> podrá seguir usando nuestro sitio web, pero es posible que algunos de los servicios y/o enlaces dejen de funcionar, y no podremos obtener de usted información muy valiosa para ofrecerle contenidos acordes a sus intereses y para que Ud. pueda acceder más fácil y rápidamente a la información de su interés.</p> <p><strong>Cambios en la política de <i>cookies</i></strong></p> <p>La página web <a href="https://www.trivicare.com" class="text-info">www.trivicare.com</a> puede modificar esta política de <i>cookies</i>, bien por incorporar <i>cookies</i> nuevas por necesidad de nuevos contenidos que se puedan ofrecer, o bien en función de exigencias legislativas, reglamentarias, que hagan necesario el cambio de la misma, por ello se aconseja a los Usuarios que la visiten antes de comenzar la navegación por la web, y cada vez que la visiten de nuevo.</p></div></div></div>')]);};var staticRenderFns=[];render._withStripped=true;

